// ==UserScript==
// @name        Apple iCloud: add Music
// @description Add Music in iCloud menus
// @version     1.0.0
// @namespace   https://breat.fr
// @homepageURL https://usercssjs.breat.fr/a/apple-icloud
// @supportURL  https://discord.gg/Q8KSHzdBxs
// @match       https://*.icloud.com/*
// @author      BreatFR
// @copyright   2024, BreatFR (https://breat.fr)
// @icon        https://breat.fr/static/images/userscripts-et-userstyles/a/apple-icloud/icon.jpg
// @license     AGPL-3.0-or-later; https://www.gnu.org/licenses/agpl-3.0.txt
// @grant       none
// @downloadURL https://update.greasyfork.org/scripts/521418/Apple%20iCloud%3A%20add%20Music.user.js
// @updateURL https://update.greasyfork.org/scripts/521418/Apple%20iCloud%3A%20add%20Music.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // Image encodée en Base64
    const musicIconBase64 = 'data:image/png;base64,';

    // Fonction pour ajouter l'application Music dans le menu principal
    function addMusicAppToMainMenu() {
        const appIconContainer = document.querySelector('.app-icon-container');
        if (appIconContainer) {
            if (!appIconContainer.querySelector('[aria-label="Ouvrir l\'app Music"]')) {
                const musicLink = document.createElement('a');
                musicLink.href = 'https://music.apple.com/';
                musicLink.className = 'IconLink app-icon-link';
                musicLink.target = '_blank';
                musicLink.rel = 'noreferrer';
                musicLink.setAttribute('aria-label', "Ouvrir l'app Music");
                musicLink.setAttribute('aria-hidden', 'false');

                const appIcon = document.createElement('div');
                appIcon.className = 'app-icon';
                appIcon.setAttribute('role', 'presentation');

                const appIconImg = document.createElement('img');
                appIconImg.src = musicIconBase64;
                appIconImg.style.width = '70px';
                appIconImg.style.height = '70px';
                appIconImg.alt = 'Music Icon';
                appIconImg.style.borderRadius = '1em';
                appIconImg.setAttribute('loading', 'lazy');
                appIcon.appendChild(appIconImg);

                const appDisplayName = document.createElement('div');
                appDisplayName.className = 'app-displayname';
                appDisplayName.setAttribute('role', 'presentation');
                appDisplayName.textContent = 'Music';

                musicLink.appendChild(appIcon);
                musicLink.appendChild(appDisplayName);

                appIconContainer.appendChild(musicLink);
            }
        }
    }

    // Fonction pour ajouter l'application Music au menu déroulant
    function addMusicAppToDropdownMenu() {
        const dropdownMenu = document.querySelector('ui-menu-scroll-container');
        if (dropdownMenu) {
            // Vérifiez si l'application Music existe déjà dans le menu
            if (!dropdownMenu.querySelector('[aria-label="Ouvrir l\'app Music"]')) {
                // Définir l'élément de référence (2ème titre du menu déroulant)
                const referenceElement = dropdownMenu.querySelector('ui-menu-item.app-switcher-wide-item.app-switcher-heading:nth-of-type(2)');
                if (referenceElement) {
                    // Créer un nouveau lien pour l'application Music
                    const musicLink = document.createElement('a');
                    musicLink.href = 'https://music.apple.com/';
                    musicLink.target = '_blank';
                    musicLink.rel = 'noreferrer';
                    musicLink.setAttribute('aria-label', "Ouvrir l'app Music");
                    musicLink.role = 'menuitem';
                    musicLink.tabIndex = -1;
                    musicLink.className = 'app-switcher-grid-cell';

                    // Créer l'icône pour Music
                    const appIcon = document.createElement('div');
                    appIcon.className = 'app-icon';
                    appIcon.setAttribute('role', 'presentation');

                    const appIconImg = document.createElement('img');
                    appIconImg.src = musicIconBase64;
                    appIconImg.alt = 'Music Icon';
                    appIconImg.style.borderRadius = '1em';
                    appIconImg.setAttribute('aria-hidden', 'true');
                    appIconImg.style.width = '54px';
                    appIconImg.style.height = '54px';
                    appIcon.appendChild(appIconImg);

                    // Créer le nom pour Music
                    const appDisplayName = document.createElement('div');
                    appDisplayName.className = 'app-switcher-app-name';
                    appDisplayName.setAttribute('role', 'presentation');
                    appDisplayName.textContent = 'Music';

                    // Ajouter l'icône et le nom à musicLink
                    musicLink.appendChild(appIcon);
                    musicLink.appendChild(appDisplayName);

                    // Ajouter le lien Music juste avant le 2ème titre
                    dropdownMenu.insertBefore(musicLink, referenceElement);
                }
            }
        }
    }

    // Observer pour détecter les changements et ajouter les liens
    function observeMenuMusic() {
        const observer = new MutationObserver(() => {
            addMusicAppToMainMenu();
            addMusicAppToDropdownMenu();
        });

        observer.observe(document.body, { childList: true, subtree: true });
    }

    // Lancer l'observateur
    window.addEventListener('load', () => {
        addMusicAppToMainMenu();
        addMusicAppToDropdownMenu();
        observeMenuMusic();
    });
})();
